startApp = function () {
    try {
        if (typeof (gapi) !== 'undefined' && !nativeAppProxyEx.IsInNativeApp()) {
            gapi.load('auth2', function () {
                gapi.client.load('plus', 'v1').then(function () {
                    gapi.signin2.render('signin-button', {
                        scope: 'https://www.googleapis.com/auth/plus.login',
                        fetch_basic_profile: false,
                        cookiepolicy: "single_host_origin"
                    });
                    gapi.auth2.init({
                        fetch_basic_profile: false,
                        scope: 'https://www.googleapis.com/auth/plus.login'
                    }).then(
                        function () {
                            auth2 = gapi.auth2.getAuthInstance();
                            auth2.isSignedIn.listen(updateSignIn);
                            auth2.then(updateSignIn);
                        });
                });
            });
        }
        else {
            initializeSocialUser(imgSrc, isMobile);
        }

    }

    catch (e) {
        console.log("error in startApp func")
    }
}

var updateSignIn = function () {
    _currentGoogleUser = new bsoftGoogleSocialUser();
    var authResult = gapi.auth2.getAuthInstance()
    if (authResult.isSignedIn.get() == true) {
        loginWithGoogle(authResult);
    }
    else {
        initializeSocialUser(imgSrc, isMobile);
    }

}


var initializeSocialUser = function (imgSrc, isMobile) {
    if (_bsoftSocialUser == null) {
        _bsoftSocialUser = new bsoftSocialUser();
        _bsoftSocialUser.initRegister();
    }

    if (_currentFacebookUser == null || _currentFacebookUser == undefined) {
        _currentFacebookUser = new bsoftFacebookSocialUser();
