        if (localFacebookId != null && localFacebookId != undefined) {
            setPersonalizationVisible(localFacebookId);
        }

    }

    //faceBookUser
    _currentFacebookUser.InitFacebookSDK(function (socialUser) {
        if (socialUser != undefined && socialUser.name == undefined) {
            socialUser.FillDetailsFromFB(function (socialUserDetailed) {
                _currentFacebookUser = socialUserDetailed;
                if (_currentFacebookUser != undefined && _currentFacebookUser.isLoggedIn) {
                    socialUserId = _currentFacebookUser.userId;
                    setPersonalizationVisible();
                    var topMenuFacebookObj = new topMenuFacebook_UIHandler(_currentFacebookUser, imgSrc, isMobile);
                    topMenuFacebookObj.HandleLoginUI(_currentFacebookUser, isMobile);
                }
            });
        }
    })

    if (_currentGoogleUser.isLoggedIn) {
        socialUserId = _currentGoogleUser.userId;
        setPersonalizationVisible();
        var topMenuFacebookObj = new topMenuFacebook_UIHandler(_currentGoogleUser, imgSrc, isMobile);
        topMenuFacebookObj.HandleLoginUI(_currentGoogleUser, isMobile);
    }
    else if (_bsoftSocialUser.isLoggedIn) {
        socialUserId = _bsoftSocialUser.userId;
        setPersonalizationVisible();
        var topMenuFacebookObj = new topMenuFacebook_UIHandler(_bsoftSocialUser, imgSrc, isMobile);
        topMenuFacebookObj.HandleLoginUI(_bsoftSocialUser, isMobile);
    }

    // anonimus user 
    // Session changed in facebook - callback
    //if (!_currentFacebookUser.isLoggedIn && !_currentGoogleUser.isLoggedIn) {
    if (!_currentFacebookUser.isLoggedIn && !_currentGoogleUser.isLoggedIn && !_bsoftSocialUser.isLoggedIn
        && typeof _currentGoogleUser.userId !== "undefined" && _currentGoogleUser.userId != null) {
        //insert the anonimuse user to DB
        var data = JSON.stringify({
            obj: {
                userId: null,
                name: null,
                gender: null,
                birthday: null,
                hometown: null,
                age_range: null,
                email: null,
                location: null,
                work: null,
                website: null,
                link: null,
                isLogedIn: null
            }
        });
        $.ajax({
            url: '/Services/Utilities.asmx/LinkFBUserToUUID',
            type: 'POST',
            contentType: 'application/json',
            data: data
        });
    }
    initializeComponents();


    //////////////////////// initialize components/////////////////

}

