// Zigit - function Callback for Zigit
getFBFirstTimeLogInDetails = function (facebookDetails) {
    if ($("#FBNameSideMenu").text() == "התחבר" || $("#FBNameSideMenu").text() == "כניסה לחשבון") {
        // HideLoader();
        var rqstApp = $(facebookDetails).find("rqstApplicationID").text();
        var userid = $(facebookDetails).find("rqstUserId").text();
        var acc_token = $(facebookDetails).find("rqstAccessToken").text();
        // Put in Local Storage
        localStorage.setItem('Zigit_FB_Access_Token', acc_token);
        localStorage.setItem('Zigit_FB_User_ID', userid);

        var cancelled = $(facebookDetails).find("rqstCancelled").text();
        var error = $(facebookDetails).find("rqstError").text();

        if (cancelled == '1') {
            return;
        }
        else if (error != 'undefined' && error != '' && error != null) {
            return;
        }
        else if (acc_token != null && acc_token != 'undefined') {
            getFBUserDataWithZigitAccessToken(acc_token, _currentFacebookUser);

        } // END ELSE

        var path = window.location.origin + '/PersonalSpace.aspx?token=999&fbid=' + userid;
        setTimeout(function () { window.location.href = path; }, 300);
    }
}

var getFBUserDataWithZigitAccessToken = function (acc_token) {

    _currentFacebookUser.Login(function (_currentFacebookUser) {
        var localAccessToken = localStorage.getItem('Zigit_FB_Access_Token');

        if (localAccessToken != null && localAccessToken != undefined) {
            socialUserId = localStorage.getItem('Zigit_FB_User_ID');
            setPersonalizationVisible();
            var topMenuFacebookObj = new topMenuFacebook_UIHandler(_currentFacebookUser, imgSrc, isMobile);
            topMenuFacebookObj.HandleLoginUI(_currentFacebookUser, isMobile);
        }
    }, acc_token);


}

