            { access_token: accessToken },
            function (response) {
                if (response.error != undefined) {
                    _thisInstance.isLoggedIn = false;
                    if (typeof callBackFunc == "function") {
                        callBackFunc(_thisInstance);
                    }

                    return;
                }

                if (_thisInstance.name == undefined) {
