    }








    this.FillDetailsFromFB = function (callBackFunc, accessToken) {

        // case 1 : B144 App
        // case 2 : Desktop of Cellular Browser

        var proxyNativeApp = new bsoftNativeAppProxy();
        if (proxyNativeApp != null && proxyNativeApp.IsInNativeApp()) {

            // case 1 : B144 App
