                    callBackFunc(_thisInstance);
                }
            }

        });
    };


    this.Login = function (callBackFunc, access_token) {


        var proxyNativeApp = new bsoftNativeAppProxy();
        if (proxyNativeApp != null && proxyNativeApp.IsInNativeApp()) {

            this.isLoggedIn = true;
            _thisInstance.FillDetailsFromFB(callBackFunc, access_token);
            _thisInstance.InitializeAll(callBackFunc);
        }

        else {
            FB.login(function () {
                this.isLoggedIn = true;
                _thisInstance.FillDetailsFromFBDesktop(callBackFunc);
                _thisInstance.InitializeAll(callBackFunc);
            }, { scope: 'email,user_birthday,user_location,user_hometown' });
        }

    };




    this.InitializeAll = function (sessionChangedCallback) {
        //debugConsole.Info("Subscribing to FB Application session change...");
        if (typeof FB === "undefined" || FB === undefined) {
            setTimeout(function () {
                _thisInstance.InitializeAll(sessionChangedCallback)
            }, 300)
            return;
        }

        FB.Event.subscribe('auth.sessionChange', function (response) {
            if (response) {
                if (response && response.status === 'connected') {
                    _thisInstance.userId = response.authResponse.userID;
                    _thisInstance.FillDetailsFromFB(function () {
                        if (typeof sessionChangedCallback == "function") {
                            sessionChangedCallback(_thisInstance);
                        }
                    });
                    _thisInstance.isLoggedIn = true;

                }
                else {
                    _thisInstance.isLoggedIn = false;
                    if (typeof sessionChangedCallback == "function") {
                        sessionChangedCallback(_thisInstance);
                    }
                }
                debugConsole.Info('auth.sessionChange : User changed : ' + _thisInstance.isLoggedIn);
            }
            else {
                currentUserFBId = 0;
                localStorage.setItem("UserId", 0);
            }
        });

        FB.getLoginStatus(function (response) {
            if (response && response.status === 'connected') {
                _thisInstance.userId = response.authResponse.userID;
                _thisInstance.isLoggedIn = true;

                _thisInstance.FillDetailsFromFB(function (loggedInUser) {
                });

                if (typeof sessionChangedCallback == "function") {
