                }
            }
            else {
                _thisInstance.isLoggedIn = false;
                if (typeof sessionChangedCallback == "function") {
                    sessionChangedCallback(_thisInstance);
                }
            }

        });


    }



    this.RegisterSessionChangeCallBack = function (sessionChangedCallback) {
        //debugConsole.Info("Subscribing to FB Application session change...");
        if (typeof FB === "undefined" || FB === undefined) {
            setTimeout(function () {
                _thisInstance.InitializeAll(sessionChangedCallback)
            }, 300)
            return;
        }


        FB.Event.subscribe('auth.statusChange', function (response) {
            if (response) {
                if (response && response.status === 'connected') {
                    _thisInstance.isLoggedIn = true;
                    _thisInstance.userId = response.authResponse.userID;
                    _thisInstance.FillDetailsFromFB(function () {
                        if (typeof sessionChangedCallback == "function") {
                            sessionChangedCallback(_thisInstance);
                        }
                    });


                }
                else {
                    _thisInstance.isLoggedIn = false;
                    if (typeof sessionChangedCallback == "function") {
                        sessionChangedCallback(_thisInstance);
                    }
                }
                debugConsole.Info('auth.sessionChange : User changed : ' + _thisInstance.isLoggedIn);
            }
            else {
                currentUserFBId = 0;
                localStorage.setItem("UserId", 0);
            }
        });
    }

    this.InitFacebookSDK = function (sessionChangedCallback) {
        (function (d, s, id) {
            var js, fjs = d.getElementsByTagName(s)[0];
            if (d.getElementById(id)) return;
            js = d.createElement(s); js.id = id;
            js.src = "//connect.facebook.net/en_US/sdk.js";
            fjs.parentNode.insertBefore(js, fjs);
        }(document, 'script', 'facebook-jssdk'));

        _thisInstance.InitializeAll(sessionChangedCallback);
    }




};

