function whatIsMyPhone(phoneNum) {

    var phoneObj = { areaCode: "", number: "", error: "מספר לא תקין", isMobile: false };

    if (typeof phoneNum !== "undefined" && phoneNum !== "") {

        phoneNum = phoneNum.trim().replace("-", "").replace(" ", "");

        phoneObj = { areaCode: "", number: "", error: "", isMobile: false };

        if (phoneNum.indexOf("05") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 3);
            phoneObj.number = phoneNum.substr(3, phoneNum.length);
            phoneObj.isMobile = true;
        } else if (phoneNum.indexOf("07") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 3);
            phoneObj.number = phoneNum.substr(3, phoneNum.length);
        } else if (phoneNum.indexOf("0") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 2);
            phoneObj.number = phoneNum.substr(2, phoneNum.length);
        }
        else if (phoneNum.indexOf("1700") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 4);
            phoneObj.number = phoneNum.substr(4, phoneNum.length);
        }
        else if (phoneNum.indexOf("1800") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 4);
            phoneObj.number = phoneNum.substr(4, phoneNum.length);
        }
        else if (phoneNum.indexOf("*") == 0) {
            phoneObj.areaCode = phoneNum.substr(0, 1);
            phoneObj.number = phoneNum.substr(1, phoneNum.length);
        }

        if (phoneNum.trim() == "") {
            phoneObj.error = "אנא הזנ/י מספר.";
        } else if (phoneObj.areaCode.trim() == "" && phoneObj.number.trim() == "") {
            phoneObj.error = "מספר טלפון לא תקין.";
        } else if (phoneNum.length != 10 && (phoneNum.length != 9 || phoneObj.areaCode.length != 2) && (phoneNum.length != 5 || phoneObj.areaCode.length != 1)) {
            phoneObj.error = "מספר טלפון לא תקין.";
        }
    }

    return phoneObj;
}


