var UserQueryStringObj = (function () {

    function QueryStringToJSON(filterBy) {
        var location = window.location.search.slice(1);
        var hash = window.location.hash.slice(1);
        var items = [];

        if (hash != "") {
            items = (location + hash).split('&');
        } else {
            items = (location).split('&');
        }

        var result = {};
        items.forEach(function (item) {

            var hasHash = (decodeURIComponent(item)).substring(item.length - 1, item.length);
            if (hasHash == "#") {
                item = (decodeURIComponent(item)).substring(0, item.length - 1);
            }

            item = item.split('=');

            if (decodeURIComponent(item[1] || '').indexOf(filterBy) > -1) {
                result[item[0].toLowerCase()] = item[1].split(filterBy);
            } else {
                result[item[0].toLowerCase()] = decodeURIComponent(item[1] || '');
            }
        });

        return JSON.parse(JSON.stringify(result));
    }

    return {
        getQueryStringJsonObj: function (splitBy) {
            splitBy = typeof splitBy !== "undefined" ? splitBy : ",";
            return QueryStringToJSON(splitBy);
        }
    }

})();

