function replaceTerms(category) {
    var categoriesTerms = category.trim().split(" ");
    var categoriesTermsString = "";
    if (categoriesTerms.length > 0) {
        categoriesTerms.forEach(function (element, index) {
            if (element.trim().length > 0) {
                var replacedTermValue = ReturnValueInJsonKeyValueObject(_replacedTermsObj.keyValueArray, element);
                if (replacedTermValue != "") {
                    categoriesTerms[index] = replacedTermValue;
                    categoriesTermsString += categoriesTerms[index] + " ";
                } else {
                    categoriesTermsString += element + " ";
                }
            }
        });

        category = categoriesTermsString.trim();
        categoryName = category;
    }

    var relatedTermValue = ReturnValueInJsonKeyValueObject(_relatedTermsObj.keyValueArray, category);
    if (relatedTermValue != "") {
        category = relatedTermValue;
    }

    return category;
}

