function isInViewport(element) {
    var elementTop = $(element).offset().top;
    var elementBottom = elementTop + $(element).outerHeight();
    var viewportTop = $(window).scrollTop();
    var viewportBottom = viewportTop + $(window).height();
    return elementBottom > viewportTop && elementTop < viewportBottom;
};

$(window).scroll(() => {
    
    var mainContentPos = $('.main-content-wrapper').offset().top;
    var scrollPos = $(window).scrollTop();
    if (scrollPos >= mainContentPos) {
        $('.search-navbar').animate().addClass('fixed-search-navbar');
        $('.story-navbar').animate().addClass('fixed-story-navbar');
    }
    else {
        $('.search-navbar').removeClass('fixed-search-navbar');
        $('.story-navbar').removeClass('fixed-story-navbar');
    }
    var homepageSections = Array.from($('.section-counter'));
    homepageSections.forEach(element => {
        if (isInViewport(element)) {
            animateSectionNumber(element)
        }
    });

})
function setWidth(itemWidth, wrapperId) {
    var updatedWidth = Math.round(($(window).width() - 120) / itemWidth) * itemWidth;
    $(wrapperId).css('width', updatedWidth);
}

function horizontalScroll(direction, itemWidth) {

    var catList = $("#category_list");
    if (catList.scrollLeft() <= itemWidth) {
        $(".move-left").hide();
    }

    if (catList.width() + catList.scrollLeft() >= ($('.nav-categories li').length - 1) * itemWidth) {
        $(".move-right").hide();
        
    } else { $(".move-right").show() }
    
    if (direction == 'left') {
        $(".move-right").show()
        catList.animate({ scrollLeft: (catList.scrollLeft() - itemWidth) })
    }
    else {
        $(".move-left").show()
        catList.animate({ scrollLeft: (catList.scrollLeft() + itemWidth) })
    }
}

