$(document).ready(function () {

    var changeZip = (!isInZipCode) ? false : isInZipCode;//check if in zipcode page

    if (changeZip == true) {
        showZipCode();
    }

    if (window.innerWidth > 768 && $(this).parent().parent().hasClass("dropWrapp")) {
        searchHeaderChangeView();
    }

    if (window.location.pathname == "/Home.aspx" || window.location.pathname == "/" || window.location.pathname == "/Home2.aspx") {
        $('#access').fadeIn('fast');
    }

    $('.tab').click(function () {
        $(this.parentNode.children).removeClass("tabActive");
        var id = $(this).attr('id');
        $('[data-target-id]').hide();
        $("[data-target-id='" + id + "']").show();
        $(this).addClass("tabActive");
    })
    
    $('.dropWrapp').click(function () {
        if (isMobile == false) {
            $(this).toggleClass("active");
            if ($('.dropWrapp').hasClass("active")) {
                $(".quickSearchHeader").css("padding-bottom","20px");
            }
            else {
                $(".quickSearchHeader").css("padding-bottom", "0");
            }
        }
    })

    $('.bezekDrop-dropItem').click(function () {
        hideZipCode()
        if (window.innerWidth > 768 && $(this).parent().parent().hasClass("dropWrapp")) {
            var activeText = $('.bezekDrop').text();
            var dropItemText = $(this).text();
            var activeId = $('.bezekDrop').attr('id');
            var dropItemId = $(this).attr('id');
            $(this).text(activeText);
            $(this).attr('id', activeId);
            $('.bezekDrop').text(dropItemText);
            $('[data-target-id]').hide();
            $("[data-target-id='" + dropItemId + "']").show();
            $('.bezekDrop').attr('id', dropItemId);
            searchHeaderChangeView();
        } else {
            $(this).addClass("selectedTab");
            $(".bezekDrop").removeClass("selectedTab");
            showPrivate();
        }
    })

    $(".bezekDrop").click(function () {
        if(!$(this).parent().hasClass("dropWrapp")){
            $(".bezekDrop-dropItem").removeClass("selectedTab");
            $(".bezekDrop").removeClass("selectedTab");
            $(this).addClass("selectedTab");
            if (changeZip == true && $(this).html().includes("מיקוד") == true) {
                showZipCode();
            }
            else {
                hideZipCode();
                showBusines();
            }
            
        }
        else {     
            if (isMobile == true) {
                $(".bezekDrop-dropItem").removeClass("selectedTab");
                $(this).addClass("selectedTab");
                showBusines();
            }
            else {
                searchHeaderChangeView();
            }
        }   
    })

    var isAndroid = (/Android/i.test(navigator.userAgent)) ? true : false;

    if (isAndroid == true && isMobile == true) {
        //bring to top the inputs-for view the autocomplete
        $(".input-business").click(function () {
            var top = $(this).offset().top;
            $("html, body").animate({ scrollTop: top }, "slow");
        });
        $(".input-city").click(function () {
            var top = $(this).offset().top;
            $("html, body").animate({ scrollTop: top }, "slow");
        });
        $(".input-zipcode").click(function () {
            var top = $(this).offset().top;
            $("html, body").animate({ scrollTop: top }, "slow");
        });
    }

    function searchHeaderChangeView() {
        var checkDivText = ($("#people").html()).trim();
        if ($(".dropWrapp").hasClass("active")) {  
            if (checkDivText == "חיפוש אנשים" || checkDivText == "אנשים") {
                showPrivate();
            }
            else {
                showBusines();
            }
        } 
    }

    function showPrivate() {
        $("#peopleImage").show();
        $("#txtNamePrivate").show();
        $("#suitcaseImg").hide();
        $("#txtCat").hide();
        $("#txtCityPrivate").show();
        $("#txtCity").hide();
        $("#b_BusinessSearch").hide();
        $("#b_PrivateSearch").css("display", "flex");
        //if (isMobile==true) {
        //    $("#b_PrivateSearch").css("display", "flex");
        //}
        //else {
        //    $("#b_PrivateSearch").css("display", "flex");
        //}
    }

    function showBusines() {
        $("#peopleImage").hide();
        $("#txtNamePrivate").hide();
        $("#suitcaseImg").show();
        $("#txtCat").show();
        $("#txtCityPrivate").hide();
        $("#txtCity").show();
        $("#b_PrivateSearch").hide();
        $("#b_BusinessSearch").css("display", "flex");
        //if (window.innerWidth < 768) {
        //    $("#b_BusinessSearch").css("display", "flex");
        //}
        //else {
        //    $("#b_BusinessSearch").show();
        //}
    }

    function showZipCode() {
        $(".inputRow").addClass("showZipcode");
        $("#txtCat").hide();
        $("#txtNamePrivate").hide();
        $("#suitcaseImg").hide();
        $("#txtCat").hide();
        $("#txtCityPrivate").hide();
        $("#txtCity").hide();
        $("#b_PrivateSearch").hide();
        $("#b_BusinessSearch").hide();
        $("#peopleImage").hide();
        $(".imgRight").hide();
        $("#city_input").show();
        $("#street_input").show();
        $("#b_ZipCodeSearch").show();
        $(".input-zipcode").show();
    }

    function hideZipCode() {
        $(".inputRow").removeClass("showZipcode");
        $(".imgRight").show();
        $(".input-zipcode").hide();
        $("#city_input").hide();
        $("#street_input").hide();
        $("#b_ZipCodeSearch").hide();  
    }

    //menu
    $('.hamburger').click(function () {
        $('#account-menu').removeClass('open');
        $('.arrow-down').removeClass('menu-open');
        if ($('#menu').hasClass('open')) {
            $('#menu').removeClass('open');
            $('.item-dropdown').removeClass("active");
        } else {
            $('#menu').addClass('open');
       } 
    })

    //account - menu

    $('#account-menu-trigger').click(function () {
        $('.arrow-down').toggleClass('menu-open');
        $('#account-menu').toggleClass('open');
        $('#menu').removeClass('open');
        $('.hamburger').removeClass("is-active");
        $('.item-dropdown').removeClass("active");
    })

    //menu dropdown
    $('.item-dropdown').click(function () {
        $(this).toggleClass('active');
    })

    //menu close by clicking on the backdrop
    $(window).click(function (e) {
        if (e.target.className.indexOf("hamburger") > -1 || e.target.className.indexOf("account-menu") > -1) {
            return;
        }

        if ($('#menu').hasClass('open') &&
            e.target.id != "menu" &&
            e.target.parentNode.id != "menu" &&
            !$(e.target.parentNode).hasClass("menu-item")) {
            $('#menu').removeClass('open');
            $('.hamburger').removeClass("is-active");
            $('.item-dropdown').removeClass("active");
        }

        if ($('#account-menu').hasClass("open") &&
            e.target.id != "account-menu" &&
            e.target.parentNode.id != "account-menu" &&
            !$(e.target.parentNode).hasClass("account-menu-item")) {
            $('#account-menu').removeClass('open');
            $('.arrow-down').removeClass('menu-open');
        }
    })

    //business result page
    $('.floatingTabs li').click(function (e) {
        $('.floatingTabs li').removeClass('active');
        $(this).addClass('active');
    })

    $(".item-dropdown").click(function () {
        var numberOfItems = document.getElementById("menu").childNodes;
        var count = 0;
        for (i = 0; i < numberOfItems.length; i++) {
            if (String(numberOfItems[i].className).indexOf("active") > -1) {
                count++;
            }
