var UserSearchHistoryObj = (function () {
    var _maxSavedSearches = 5;
    var _localStorageKeyName = "";
    var _userSearchArray = [];
    var _error = []; // todo: use this array

    function pushSearchString(userSearchObj) {

        setLocalStorageKeyName(userSearchObj)

        var insertSearchString = false;
        var localStorageMaxIndex = getIndex(true);
        var localStorageMinIndex = getIndex(false);
        var localStorageIndex = 0;

        insertSearchString = userSearchObj.checkParametersValidity();

        if (insertSearchString) {
            var isOldSearchMatched = false;
            var localStorageString = "";
            var localStorageIndexTemp = "";
            var localStorageCount = 0;
            var storageObj = {};

            for (var i = 0; i < localStorage.length; i++) {
                localStorageString = localStorage.key(i);
                if (localStorageString.match("^" + _localStorageKeyName)) {
                    localStorageIndexTemp = localStorageString.substring(localStorageString.length - 1, localStorageString.length);
                    if (!isNaN(localStorageIndexTemp)) {
                        localStorageIndex = parseInt(localStorageIndexTemp);
                        localStorageCount++;
                        storageObj = JSON.parse(localStorage.getItem(localStorageString));

                        // check if the current search already exists
                        isOldSearchMatched = userSearchObj.CurrentSearchExists(storageObj);

                        if (isOldSearchMatched) {
                            localStorage.removeItem(localStorageString);
                            break;
                        }
                    }
                }
            }

            // max of array search history
            if (localStorageCount >= _maxSavedSearches) {
                localStorage.removeItem(_localStorageKeyName + localStorageMinIndex);
            }

            localStorage.setItem(_localStorageKeyName + (localStorageMaxIndex + 1), JSON.stringify(userSearchObj));
        }
    }

    function setLocalStorageKeyName(userSearchObj) {


        if (userSearchObj.constructor.name == "SingleInputSearchHistory"
    && typeof userSearchObj.InputId !== "undefined"
    && userSearchObj.InputId != "") {
            _localStorageKeyName = userSearchObj.constructor.name + "-" + userSearchObj.InputId;
        } else {
            _localStorageKeyName = userSearchObj.constructor.toString().substring('function '.length);
            _localStorageKeyName = _localStorageKeyName.substring(0, _localStorageKeyName.indexOf('('));
        }
    }

    function getIndex(max) {
        var _max = -1;
        var _min = -1;

        if (window.localStorage) {
            var indexs = [];
            for (var i = 0; i < localStorage.length; i++) {
                var localStorageString = localStorage.key(i);
                var localStorageIndex = "";
                if (localStorageString.match("^" + _localStorageKeyName)) {
                    localStorageIndex = localStorageString.replace(_localStorageKeyName, "");
                    if (!isNaN(localStorageIndex)) {
                        indexs.push(parseInt(localStorageIndex));
                    }
                }
            }

            if (indexs.length > 0) {
                _max = Math.max.apply(null, indexs);
                _min = Math.min.apply(null, indexs);
            } else {
                _max = 0;
                _min = 0;
            }
        }

        if (typeof max !== "undefined" && max == true) {
            return _max;
        } else if (typeof max !== "undefined" && max == false) {
            return _min;
        } else {
            return -1;
        }
    }

    function filterArrayFunction(element) {
        var item = "";

        if (typeof element.SearchValue != "undefined" && element.SearchValue.trim() != "") {
            item = element.SearchValue.trim();
        }
        else {

            if (typeof element.CategoryName != "undefined" && element.CategoryName.trim() != "") {
                item = element.CategoryName.trim();
            } else if (typeof element.MemberName != "undefined" && element.MemberName.trim() != "") {
                item = element.MemberName.trim();
            }

            if (typeof element.AreaName != "undefined" && element.AreaName.trim() != "") {
                item = element.AreaName.trim();
            }
        }

        return item
    }

    function pullUserSearchHistoryArray(userSearchObj) {
        _userSearchArray = [];
        setLocalStorageKeyName(userSearchObj);

        if (window.localStorage) {
            for (var i = localStorage.length - 1; i > -1; i--) {
                var localStorageString = localStorage.key(i);
                if (localStorageString.match("^" + _localStorageKeyName)) {
                    var keyIndex = localStorageString.replace(_localStorageKeyName, "");
                    if (!isNaN(keyIndex)) {
                        try {
                            _userSearchArray.push(JSON.parse(localStorage.getItem(localStorageString)));
                        } catch (ex) {
                            continue;
                        }
                    }
                }
            }
        }

        _userSearchArray.sort(function (a, b) {
            return new Date(b.insertDate).getTime() - new Date(a.insertDate).getTime()
        });

        return _userSearchArray;
    }

    function pullUserSearchHistoryHtml(userSearchObj) {
        _userSearchArray = pullUserSearchHistoryArray(userSearchObj);
        return userSearchObj.getHtml(_userSearchArray);
    }

    // public methods
    return {
        pushUserSearchObj: function (SearchHistoryObj) {
            pushSearchString(SearchHistoryObj);
        },
        pullUserSearchHistory: function (SearchHistoryObj) {
            return pullUserSearchHistoryHtml(SearchHistoryObj);
        },
        pullUserSearchHistoryArray: function (SearchHistoryObj) {
            var objArray = pullUserSearchHistoryArray(SearchHistoryObj);
            var valuesArray = objArray.map(filterArrayFunction);

            return valuesArray;
        }
    }
})();

